(9, 1, '2019-09-19 18:32:48', '2019-09-19 18:32:48', '<!-- wp:html -->\n<form class=\"about-form\">\n<p class=\"one\">Welcome to Angel\'s Accessories online jewelry and fashion store.<br>\n	<br>\n	A little online store started in a room in April 2019.<br>\n	<br>\n	The name \'Angel\'s\' from my name Angelito - \'Angel\'s\' Accessories.<br>\n	<br>\n	I have always believed in making an impressive statement! In my more youthful days since High School (15 years ago) you would never find me without wearing jewellery, and that different everyday too, so I got this idea to sell online, considering I had worked for two big companies on their website side of things I had a little faith in myself.<br>\n	<br>\n	My love and passion for jewellery and fashion is reflected in my collection.<br>\n	<br>\n	I personally choose each and every piece, examine it and then decide if it is good enough to represent Angel\'s Accessories.<br>\n	<br>\n	I always ensure the fashion pieces I stock is the most stylish, high quality, affordable and eye-catching to make sure you stand out from the crowd.<br>\n	<br>\n	Thankyou to each and every soul out there who chooses to purchase from me, you are making my dreams come true one necklace at a time.<br>\n	<br>\n	Elevate out of the ordinary and wear Angel\'s Accessories.<br>\n	<br>\n</p>\n</form>\n<!-- /wp:html -->', 'About Us?', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2019-10-01 07:05:59', '2019-10-01 07:05:59', '', 0, 'http://localhost:8080/EcommerceWordpress/?page_id=9', 0, 'page', '', 0),
(10, 1, '2019-09-19 18:32:48', '2019-09-19 18:32:48', '<!-- wp:paragraph -->\n<p>Welcome to Angel\'s Accessories online jewellery and fashion store. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A little online store started in a room in April 2019. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The name \'Angel\'s\' from my name Angelito - \'Angel\'s\' Accessories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I have always believed in making an impressive statement! In my more youthful days since High School (15 years ago) you would never find me without wearing jewellery, and that different everyday too, so I got this idea to sell online, considering I had worked for two big companies on their website side of things I had a little faith in myself.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My love and passion for jewellery and fashion is reflected in my collection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I personally choose each and every piece, examine it and then decide if it is good enough to represent Angel\'s Accessories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I always ensure the fashion pieces I stock is the most stylish, high quality, affordable and eye-catching to make sure you stand out from the crowd.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Thankyou to each and every soul out there who chooses to purchase from me, you are making my dreams come true one necklace at a time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elevate out of the ordinary and wear Angel\'s Accessories. </p>\n<!-- /wp:paragraph -->', 'About Us?', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2019-09-19 18:32:48', '2019-09-19 18:32:48', '', 9, 'http://localhost:8080/EcommerceWordpress/2019/09/19/9-revision-v1/', 0, 'revision', '', 0),
