(21, 1, '2019-09-19 18:40:20', '2019-09-19 18:40:20', '<!-- wp:html -->\n<div class=\"contact-area section-padding\" id=\"contact\">\n        <div class=\"container\">\n           <div class=\"row\">\n                <div class=\"col-md-3 col-sm-6\">\n                    <div class=\"single-contact text-center wow fadeInDown\" data-wow-delay=\"0.4s\">\n                        <i class=\"fa fa-home\"></i>\n                        <h2>Location</h2>\n                        <p>123 Dasma, Cavite</p> <!--edit here-->\n                    </div>\n                </div>\n                <div class=\"col-md-3 col-sm-6\">\n                    <div class=\"single-contact text-center wow fadeInDown\" data-wow-delay=\"0.6s\">\n                        <i class=\"fa fa-phone\"></i>\n                        <h2>Phone: </h2>\n                        <p>+63 975 347 2962</p> <!--edit here-->\n                    </div>\n                </div>\n                <div class=\"col-md-3 col-sm-6\">\n                    <div class=\"single-contact text-center wow fadeInDown\" data-wow-delay=\"0.8s\">\n                        <i class=\"fa fa-envelope\"></i>\n                        <h2>Email</h2>\n                        <p>borinaga.angelito@gmail.com</p> <!--edit here-->\n                    </div>\n                </div>\n                <div class=\"col-md-3 col-sm-6\">\n                    <div class=\"single-contact text-center wow fadeInDown\" data-wow-delay=\"1s\">\n                        <i class=\"fab fa-gg\"></i>\n                        <h2>Social Media: </h2>\n                        <div class=\"socials\">\n                            <a href=\"https://www.facebook.com/angelito.borinaga1\"><i class=\"fab fa-facebook-messenger\"></i></a>\n					<a href=\"https://mobile.twitter.com/Borinaga0629\"><i class=\"fab fa-twitter\"></i></a>\n					<a href=\"https://myaccount.google.com/?utm_source=OGB&tab=kk&utm_medium=act\"><i class=\"fab fa-google-plus\"></i></a>\n					<a href=\"https:/