(108, 1, '2019-10-01 05:06:07', '2019-10-01 05:06:07', '<!-- wp:html -->\n<div class=\"contact-area section-padding\" id=\"contact\">\n			<div class=\"row\">\n\n				<div class=\"col-md-10 col-md-offset-1 mx-auto\">\n					<form id=\"contact-form\" method=\"post\" action=\"contact.php\" class=\"wow fadeInDown\" data-wow-delay=\"1.2s\">\n\n						<div class=\"about\">\n							<p>Welcome to Angel\'s Accessories online jewellery and fashion store.\n								A little online store started in a room in April 2019.\n								The name \'Angel\'s\' from my name Angelito - \'Angel\'s\' Accessories.\n								I have always believed in making an impressive statement! In my more youthful days since High School (15 years ago) you would never find me without wearing jewellery, and that different everyday too, so I got this idea to sell online, considering I had worked for two big companies on their website side of things I had a little faith in myself.\n								My love and passion for jewellery and fashion is reflected in my collection.\n								I personally choose each and every piece, examine it and then decide if it is good enough to represent Angel\'s Accessories.\n								I always ensure the fashion pieces I stock is the most stylish, high quality, affordable and eye-catching to make sure you stand out from the crowd.\n								Thankyou to each and every soul out there who chooses to purchase from me, you are making my dreams come true one necklace at a time.\n								Elevate out of the ordinary and wear Angel\'s Accessories.\n							</p>\n						</div>\n						<!--you can change the message in contact.php file -->\n\n					</form>\n				</div>\n\n			</div>\n		</div>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Welcome to Angel\'s Accessories online jewellery and fashion store. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A little online store started in a room in April 2019. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The name \'Angel\'s\' from my name Angelito - \'Angel\'s\' Accessories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I have always believed in making an impressive statement! In my more youthful days since High School (15 years ago) you would never find me without wearing jewellery, and that different everyday too, so I got this idea to sell online, considering I had worked for two big companies on their website side of things I had a little faith in myself.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My love and passion for jewellery and fashion is reflected in my collection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I personally choose each and every piece, examine it and then decide if it is good enough to represent Angel\'s Accessories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I always ensure the fashion pieces I stock is the most stylish, high quality, affordable and eye-catching to make sure you stand out from the crowd.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Thankyou to each and every soul out there who chooses to purchase from me, you are making my dreams come true one necklace at a time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elevate out of the ordinary and wear Angel\'s Accessories. </p>\n<!-- /wp:paragraph -->', 'About Us?', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2019-10-01 05:06:07', '2019-10-01 05:06:07', '', 9, 'http://localhost:8080/EcommerceWordpress/2019/10/01/9-revision-v1/', 0, 'revision', '', 0),
